import React from 'react';
import { V, Route, BrowserRouter } from 'react-router-dom';
import './App.css';

import Login from "./containers/login";

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        {/* <Route path='/Login' component={Login} /> */}
        <Route path='/Login' element={<Login/>} />
      </Switch>
    </BrowserRouter>

    // <div>Hello World</div>
  )
}

export default App;
